import { createMuiTheme } from "@material-ui/core/styles";

export const theme = createMuiTheme({
  palette: {
    primary: {
      light: "#449594",
      main: "#006766",
      dark: "#003c3c",
      contrastText: "#000000",
    },
    secondary: {
      light: "#ff9865",
      main: "#ee6738",
      dark: "#b5360a",
      contrastText: "#ffffff",
    },
  },
});
